import axios from 'axios';

export const GET_POKEMONS = 'GET_POKEMONS'

export async function getPokemons(page){
    const data = await axios.get('http://localhost:3001/pokemons')
    return {
        type: GET_POKEMONS,
        payload: {data, page}
    }
}
